import back from "@/components/Botton/back.vue";
import { apiGetMyClubGamblingBetResultList, apiGetClubGamblingBetResult } from "@/api/ClubGamblings.js";
export default {
  components: {
    back: back
  },
  created: function created() {
    this.lang = JSON.parse(localStorage.getItem("lang")).tag;

    if (localStorage.getItem("singleResult") == undefined || localStorage.getItem("singleResult") == null || localStorage.getItem("singleResult") == "false") {
      this.getMyBetResult();
    } else {
      this.betId = localStorage.getItem("betId");
      this.singleBetResult();
    }
  },
  data: function data() {
    return {
      lang: "",
      resultData: [],
      betId: "",
      noData: false
    };
  },
  methods: {
    // 所有發起人賽果列表
    getMyBetResult: function getMyBetResult() {
      var _this = this;

      this.resultData = [];
      var data = {};
      apiGetMyClubGamblingBetResultList(data, true).then(function (res) {
        if (Math.abs(res.Code) >= 600) {
          var vm = _this;
          var m = vm.$message({
            message: res.Message,
            duration: 3000,
            type: "error",
            center: true
          });
          setTimeout(function () {
            m.close();

            _this.$router.push("/myClub");
          }, 2000);
          return;
        }

        _this.resultData = res.Data;
        _this.resultData.length <= 0 ? _this.noData = true : _this.noData = false;
      });
    },
    // 單一點擊查看
    singleBetResult: function singleBetResult() {
      var _this2 = this;

      this.resultData = [];
      var data = {
        clubGamblingId: this.betId
      };
      apiGetClubGamblingBetResult(data, true).then(function (res) {
        if (Math.abs(res.Code) >= 600) {
          var vm = _this2;
          var m = vm.$message({
            message: res.Message,
            duration: 3000,
            type: "error",
            center: true
          });
          setTimeout(function () {
            m.close();

            _this2.$router.push("/myClub");
          }, 2000);
          return;
        }

        _this2.resultData = res.Data;
        _this2.resultData.length <= 0 ? _this2.noData = true : _this2.noData = false;
      });
    }
  },
  destroyed: function destroyed() {
    localStorage.setItem("singleResult", false);
  }
};
